import{Component} from 'react';
import {link} from "react-router-dom";
import './Navbar.css'

class Navbar extends Component{
    render(){
        return(
            <nav classnam="NavbarItems">
                <h1 classname="logo">Ratz</h1>

                <ul classname="Menu">
                    <li>
                        <a>HOME</a>
                    </li>
                    <li>
                        <a>ABOUT</a>
                    </li>
                    <li>
                        <a>CONTACT US</a>
                    </li>

                </ul>

            </nav>
        )
    }
}
 export default Navbar;
